import { Fragment } from "react";
import mealsImage from "../../assets/meals.jpg";

const Header = (props) => {
    return(
        <Fragment>
            <header>
                <h1>BhojMahal</h1>
                <button>Cart</button>
            </header>
            <img src={mealsImage}/>
        </Fragment>
    )
};
export default Header;
